import React from 'react';
import * as S from './projects-next.styles';
import Text from "../common/Text";

const Project_Next = ({projectTitle}) => {
    return (
        <S.Project_Next_Container>
        <S.Project_Next_Title>
            <Text
                as={"h2"}
                
            >
                {projectTitle}
            </Text>
        </S.Project_Next_Title>

        </S.Project_Next_Container>
    );
};

export default Project_Next;
